import paraData from "../data/para.json";

const Para = () => {
  return (
    <div className="para">
      {paraData.map((para) => {
        return (
          <div>
            <h2>{para.title}</h2>
            <p>{para.content}</p>
          </div>
        );
      })}

      <button>Learn More...</button>
    </div>
  );
};

export default Para;
